import React from "react";
import {
    ImageBackground,
    StyleSheet, 
    Text, 
    TextInput, 
    TouchableOpacity, 
    View,
} from 'react-native';
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";

const stack = createStackNavigator();
function Cari(){
  return(
    <View>
      <text>ini screen untuk mencari jadwal</text>
    </View>
  )
}

function App(){
  return(
    <NavigationContainer>
      <stack.Navigator>
          <stack.Screen
            name="Cari"
            component={Cari}
          />
        </stack.Navigator>
      </NavigationContainer>
  )
}

export default App;
